CREATE TABLE public.users (
id serial4 NOT NULL,
"name" varchar(255) NOT NULL,
email varchar(255) DEFAULT NULL::character varying NULL,
email_verified_at timestamp NULL,
"password" varchar(255) NOT NULL,
remember_token varchar(100) DEFAULT NULL::character varying NULL,
created_at timestamp NULL,
updated_at timestamp NULL,
branch_id int8 NULL,
is_superuser bool DEFAULT false NOT NULL,
deleted_at timestamp NULL,
address_id int8 NULL,
password_updated_at timestamp NULL,
cpf varchar(14) DEFAULT NULL::character varying NULL,
id_departamento int8 NULL,
pessoal_id int8 NULL,
departamento_id int8 NULL,
filial_id int4 NULL,
avatar varchar(255) DEFAULT NULL::character varying NULL,
two_factor_confirmed_at timestamp NULL,
two_factor_secret text NULL,
two_factor_recovery_codes text NULL,
has_password_updated bool DEFAULT false NOT NULL,
last_login_at timestamp NULL,
last_login_ip varchar NULL,
current_branch_id int8 NULL,
is_ativo bool DEFAULT true NOT NULL,
matricula int8 NULL,
rg varchar(25) DEFAULT NULL::character varying NULL,
orgao_emissor varchar(25) DEFAULT NULL::character varying NULL,
data_nascimento date NULL,
data_admissao date NULL,
cnh int8 NULL,
validade_cnh date NULL,
tipo_cnh varchar(10) DEFAULT NULL::character varying NULL,
pis int8 NULL,
imagem_pessoal varchar(150) DEFAULT NULL::character varying NULL,
role_id int4 NULL,
CONSTRAINT users_cpf_key UNIQUE (cpf),
CONSTRAINT users_email_key UNIQUE (email),
CONSTRAINT users_matricula_key UNIQUE (matricula),
CONSTRAINT users_pkey PRIMARY KEY (id),
CONSTRAINT users_address_id_foreign FOREIGN KEY (address_id) REFERENCES public.addresses(id) ON DELETE SET NULL,
CONSTRAINT users_branch_id_foreign FOREIGN KEY (branch_id) REFERENCES public.branches(id),
CONSTRAINT users_current_branch_id_foreign FOREIGN KEY (current_branch_id) REFERENCES public.branches(id),
CONSTRAINT users_departamento_id_foreign FOREIGN KEY (departamento_id) REFERENCES public.departamento(id_departamento) ON DELETE SET NULL,
CONSTRAINT users_id_departamento_foreign FOREIGN KEY (id_departamento) REFERENCES public.departamento(id_departamento) ON DELETE SET NULL
);
CREATE INDEX idx_users_pessoal_id ON public.users USING btree (pessoal_id);

